// Routes.js

import React from 'react';
import { BrowserRouter as Router, Route, Routes, Sw } from 'react-router-dom';
import Product from './product';
import App from './App';

const AppRoutes = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Product />} />
        <Route path="/app" element={<App />} />
      </Routes>
    </Router>
  );
};

export default AppRoutes;
